import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const UserListPage = () => {
  const [users, setUsers] = useState([]);

  // In a real application, you would fetch users from an API
  useEffect(() => {
    const fetchUsers = async () => {
      // const response = await userService.getAllUsers();
      // setUsers(response.data);
      setUsers([
        { id: 101, username: 'john.doe', email: 'john.doe@example.com', role: 'Admin', status: 'Active' },
        { id: 102, username: 'jane.smith', email: 'jane.smith@example.com', role: 'User', status: 'Active' },
        { id: 103, username: 'peter.jones', email: 'peter.jones@example.com', role: 'User', status: 'Inactive' },
      ]);
    };
    fetchUsers();
  }, []);

  const handleDeleteUser = (id) => {
    if (window.confirm('Are you sure you want to delete this user?')) {
      console.log('Deleting user with ID:', id);
      setUsers(users.filter(user => user.id !== id));
      // In a real application, call userService.deleteUser(id);
    }
  };

  const handleToggleUserStatus = (id) => {
    setUsers(users.map(user =>
      user.id === id ? { ...user, status: user.status === 'Active' ? 'Inactive' : 'Active' } : user
    ));
    console.log('Toggling status for user with ID:', id);
    // In a real application, call userService.toggleUserStatus(id);
  };

  return (
    <div className="container mx-auto p-4">
      <h2 className="text-2xl font-bold mb-4">User List</h2>
      <div className="flex justify-end mb-4">
        {/* <Link to="/users/create" className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded">
          Create New User
        </Link> */}
        {/* Placeholder for future user creation if needed */}
      </div>
      {users.length === 0 ? (
        <p>No users available.</p>
      ) : (
        <div className="overflow-x-auto">
          <table className="min-w-full bg-white shadow-md rounded-lg overflow-hidden">
            <thead className="bg-gray-200 text-gray-700">
              <tr>
                <th className="py-2 px-4 text-left">ID</th>
                <th className="py-2 px-4 text-left">Username</th>
                <th className="py-2 px-4 text-left">Email</th>
                <th className="py-2 px-4 text-left">Role</th>
                <th className="py-2 px-4 text-left">Status</th>
                <th className="py-2 px-4 text-left">Actions</th>
              </tr>
            </thead>
            <tbody className="text-gray-600">
              {users.map((user) => (
                <tr key={user.id} className="border-b border-gray-200 hover:bg-gray-100">
                  <td className="py-2 px-4">{user.id}</td>
                  <td className="py-2 px-4">{user.username}</td>
                  <td className="py-2 px-4">{user.email}</td>
                  <td className="py-2 px-4">{user.role}</td>
                  <td className="py-2 px-4">
                    <span className={`px-2 inline-flex text-xs leading-5 font-semibold rounded-full ${user.status === 'Active' ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'}`}>
                      {user.status}
                    </span>
                  </td>
                  <td className="py-2 px-4 flex space-x-2">
                    {/* Assuming user edit will be similar to pool edit, but not explicitly requested */}
                    {/* <Link
                      to={`/users/edit/${user.id}`}
                      className="bg-yellow-500 hover:bg-yellow-700 text-white font-bold py-1 px-3 rounded text-xs"
                    >
                      Edit
                    </Link> */}
                    <button
                      onClick={() => handleToggleUserStatus(user.id)}
                      className={`${user.status === 'Active' ? 'bg-red-500 hover:bg-red-700' : 'bg-green-500 hover:bg-green-700'} text-white font-bold py-1 px-3 rounded text-xs`}
                    >
                      {user.status === 'Active' ? 'Deactivate' : 'Activate'}
                    </button>
                    <button
                      onClick={() => handleDeleteUser(user.id)}
                      className="bg-gray-500 hover:bg-gray-700 text-white font-bold py-1 px-3 rounded text-xs"
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default UserListPage;
